import React, { useState } from 'react';
import Navbar from 'your-navbar-library'; // Import your navbar library
import CombinedForm from '../cmpts/Patient/';
import PatientPage from '../cmpts/Patient/PatientPgae';

function App() {
  const [selectedComponent, setSelectedComponent] = useState('post'); // Default to 'post'

  const handleComponentChange = (component) => {
    setSelectedComponent(component);
  };

  return (
    <>
      <Navbar>
        {/* Add your existing navbar content here */}
        {/* For example: */}
        <Navbar.Brand>Your App Name</Navbar.Brand>
        <Navbar.Toggle />

        {/* Add buttons for component selection */}
        <Navbar.Collapse className="justify-content-end">
          <button
            className={`btn ${selectedComponent === 'post' ? 'btn-primary' : 'btn-secondary'}`}
            onClick={() => handleComponentChange('post')}
          >
            Create Post
          </button>
          <button
            className={`btn ${selectedComponent === 'card' ? 'btn-primary' : 'btn-secondary'}`}
            onClick={() => handleComponentChange('card')}
          >
            Patient Page
          </button>
        </Navbar.Collapse>
      </Navbar>

      {/* Render the selected component */}
      {selectedComponent === 'post' && <CombinedForm />}
      {selectedComponent === 'card' && <PatientPage />}
    </>
  );
}

export default App;
